  first: number;
  rows: number;
  page: number;
  pageCount: number;
}
@Component({
  selector: 'app-patient',
  templateUrl: './patient.component.html',
  styleUrls: ['./patient.component.scss'],
  providers:[MessageService]
})
export class PatientComponent implements OnInit
 {

  productDialog: boolean = false;
  Patients !: Patient[] ;
  first: number = 0;

  rows: number = 10;
